@dev Retrieves the snapshot timestamp of a given proposal.
@param governor The governor contract that manages the proposal.
@param proposalId The unique identifier for the proposal in question.
@return snapshot The timestamp at which the voting snapshot for the proposal was taken.

@dev Gets the deadline timestamp for voting on a specified proposal.
@param governor The governor contract that manages the proposal.
@param proposalId The unique identifier for the proposal.
@return deadline The timestamp by which votes for the proposal need to be submitted.

@dev Calculates the deadline for proxy voting on a particular proposal.
     The proxy voting deadline is set at 80% of the full voting window to ensure
     that proxy votes are cast before the final voting deadline.
@param governor The governor contract that oversees the proposal.
@param proposalId The unique identifier for the proposal.
@return proxyDeadline The timestamp by which proxy votes for the proposal must be submitted.
